import React from 'react';
import axios from 'axios';
import './App.css';

class App extends React.Component{
  constructor(props){
    super(props)
    this.state = {
      users:[],
      data:[],
      login:[],
      gravatar_id:"",
      repos_url:"",
      avatar_url:"",
      url:"",
      html_url:""

    }
  }

componentDidMount = () =>{
    axios.get("https://api.github.com/users/Jounicrypto?client_id=930dc05feec17fe2f949&client_secret=fcb7be46d7fe196c3a779b82457fd280907a1328&sort=created")
    .then(res =>{
      // console.log(res)
      this.setState({
        users : res.data,
        login : res.data
      })
    }).catch(err =>{
      console.log(err)
    })
  }

  render(){
    console.log(this.state.users)
  return (
    <div className="App">
      <h1>List of Github Users</h1>
      <ul>
      {this.state.login.map((value, index)=>{
        return(
          <div key={value.id} typeof='U'>
            <li>{value.users}</li>
            <li>{value.login}</li>
            <li>{value.repos_url}</li>
            <img src={value.repos_url}></img>
            <li>{value.avatar_url}</li>
            {/* <li>{value.gravatar_id}</li> */}
          </div>
        )
      })}
      </ul>
    </div>
  );
}
}

export default App;
